    def licenseKeyFormatting(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: str
        """

        s = s.replace('-', '').upper()
        n = len(s)
        if n <= k:
            return s

        res = []
        i = n - 1
        while i >= 0:
            if len(res) % (k + 1) == 0:
                res.append('-')
            res.append(s[i])
            i -= 1
        return ''.join(res[::-1])

