class Solution(object):
    def maxNumber(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def pick(nums, k):
            out = []
            for i in range(len(nums)):
                if len(out) < k:
                    if nums[i] > out[-1]:
                        out.append(nums[i])
                else:
                    if nums[i] > out[-1]:
                        out.pop()
                        out.append(nums[i])
            return out

        def merge(nums1, nums2):
            out = []
            i, j = 0, 0
            while i < len(nums1) and j < len(nums2):
                if nums1[i] > nums2[j]:
                    out.append(nums1[i])
                    i += 1
                else:
                    out.append(nums2[j])
                    j += 1
            out += nums1[i:]
            out += nums2[j:]
            return out

        def find_max(nums, k):
            out = []
            for i in range(len(nums)):
                if len(out) < k:
                    out.append(nums[i])
                else:
                    if nums[i] > out[-1]:
                        out.pop()
                        out.append(nums[i])
            return out

        if len(nums1) < k:
            return merge(nums2, nums1)
        if len(nums2) < k:
            return merge(nums1, nums2)

        out = []
        for i in range(k+1):
            if i <= len(nums1):
                out1 = pick(nums1, i)
            else:
                out1 = []
            if k-i <= len(nums2):
                out2 = pick(nums2, k-i)
            else:
                out2 = []
            out = merge(out, find_max(merge(out1, out2), k-i))
        return out

