    def generateParenthesis(self, n):
        """
        :type n: int
        :rtype: List[str]
        """

        if n == 0:
            return []
        if n == 1:
            return ['()']

        res = []
        for i in range(n):
            left = self.generateParenthesis(i)
            right = self.generateParenthesis(n-i-1)
            for l in left:
                for r in right:
                    res.append('({}){}'.format(l,r))
        return res

